import React from 'react';
import { Link } from 'react-router-dom';
import VenueCard from './VenueCard';
import { useState, useEffect } from 'react';
import axios from 'axios'

function Venue() {

  const [eventData, setEventData] = useState({
    "events": [
      {
        "eventId": "Z698xZu0ZaGQo",
        "eventName": "Childish Gambino",
        "artistNames": ["Childish Gambino"],
        "dateAndTime": [2024, 11, 12],
        "salesStart-End": "2024-05-17T08:00:00Z to 2024-11-12T22:59:00Z",
        "priceRange": [1490.0, 4242.0],
        "genreId": "KnvZfZ7vAvv",
        "venue": {
          "name": "O2 Arena", "address": "\u010ceskomoravsk\u00e1 2345/17a, Praha 9", "phoneNumber": "020 8463 2000", "rating": "4.5 / 5", "website": "https://www.theo2.co.uk/"
        },
        "ticketmasterURL": "https://www.ticketmaster.cz/event/childish-gambino-tickets/50833?language=en-us"
      }
    ]
  });

  useEffect(() => {
    const fetchData = async () => {
      try {
        const response = await axios.get("/api/GetAllEvents/");
        setEventData(response.data)
      } catch (error) {
        console.error("Error:", error)
      }
    }
    fetchData()
  })


  return (
    <div>
      <div>
        <h2>Events</h2>
        <p>Events all across the US! </p>
      </div>

      <div class="row g-4 m-5">
        {
          eventData.events.map((event, index) => (
            <div class="col-lg-4 ">
              <VenueCard key ={index}

               ></VenueCard>
            </div>
          ))
        }

        <div class="col-lg-4 ">
          <VenueCard ></VenueCard>
        </div>
        <div class="col-lg-4 ">
          <VenueCard ></VenueCard>
        </div>

      </div>

    </div>

  );
}

export default Venue;


